import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { MaxDiscViewContainerComponent } from './src/app/catalog/view/max-disc-view.container/max-disc-view.container.component';
import { DiscViewContainerComponent } from './view/disc-view.container/disc-view.container.component';

@NgModule({
  declarations: [
    AppComponent,
    MaxDiscViewContainerComponent,
    DiscViewContainerComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
